Any synchronous Effect can by lifted into an asynchronous Aff with liftEffect. Similarly, any Aff can be converted to an Effect Unit with launchAff_. Below is the code that prints a random number in terms of Aff, written in a few different styles: module Main where import Prelude import Effect (Effect)
import Effect.Aff (Aff, launchAff_)
import Effect.Class (liftEffect)
import Effect.Console (logShow)
import Effect.Random (random) printRandomStyle1a :: Aff Unit
printRandomStyle1a = liftEffect doRandom where doRandom :: Effect Unit doRandom = do n <- random logShow n printRandomStyle1b :: Aff Unit
printRandomStyle1b = liftEffect $ do n <- random logShow n printRandomStyle2 :: Aff Unit
printRandomStyle2 = do n <- liftEffect random liftEffect $ logShow n printRandomStyle3 :: Aff Unit
printRandomStyle3 = do n <- random # liftEffect (logShow n) # liftEffect main :: Effect Unit
main = launchAff_ do printRandomStyle1a printRandomStyle1b printRandomStyle2 printRandomStyle3 printRandomStyle1a and printRandomStyle1b are nearly the same, but the types more explicit in printRandomStyle1a to add additional clarity. In both, the do block results in something with type Effect Unit and is lifted to Aff outside of the do block. In printRandomStyle2, both random and logShow are lifted to Aff inside the do block, which results in an Aff. Often while writing PureScript, you'll encounter cases where Aff and Effect need to be mixed, so style 2 is the more common case. Finally in printRandomStyle3, the liftEffect function has been moved to the right with #, which applies an argument to a function instead of the regular function call with arguments. The purpose of this style is to make the intent of the statement more clear by moving the boilerplate out of the way to the right.

