Calling a PureScript function from JavaScript is very simple, at least for functions with simple types. Let's take the following simple module as an example: module Test where gcd :: Int -> Int -> Int
gcd 0 m = m
gcd n 0 = n
gcd n m | n > m = gcd (n - m) m | otherwise = gcd (m - n) n This function finds the greatest common divisor of two numbers by repeated subtraction. It is a nice example of a case where you might like to use PureScript to define the function, but have a requirement to call it from JavaScript: it is simple to define this function in PureScript using pattern matching and recursion, and the implementor can benefit from the use of the type checker. To understand how this function can be called from JavaScript, it is important to realize that PureScript functions always get turned into JavaScript functions of a single argument, so we need to apply its arguments one-by-one: var Test = require('Test');
Test.gcd(15)(20); Here, I am assuming that the code was compiled with spago build, which compiles PureScript modules to CommonJS modules. For that reason, I was able to reference the gcd function on the Test object, after importing the Test module using require. You might also like to bundle JavaScript code for the browser, using spago bundle-app --to file.js. In that case, you would access the Test module from the global PureScript namespace, which defaults to PS: var Test = PS.Test;
