For every constructor of an algebraic data type, the PureScript compiler creates a new JavaScript object type by defining a function. Its constructors correspond to functions which create new JavaScript objects based on those prototypes. For example, consider the following simple ADT: data ZeroOrOne a = Zero | One a The PureScript compiler generates the following code: function One(value0) { this.value0 = value0;
}; One.create = function (value0) { return new One(value0);
}; function Zero() {
}; Zero.value = new Zero(); Here, we see two JavaScript object types: Zero and One. It is possible to create values of each type by using JavaScript's new keyword. For constructors with arguments, the compiler stores the associated data in fields called value0, value1, etc. The PureScript compiler also generates helper functions. For constructors with no arguments, the compiler generates a value property, which can be reused instead of using the new operator repeatedly. For constructors with one or more arguments, the compiler generates a create function, which takes arguments with the appropriate representation and applies the appropriate constructor. What about constructors with more than one argument? In that case, the PureScript compiler also creates a new object type, and a helper function. This time, however, the helper function is curried function of two arguments. For example, this algebraic data type: data Two a b = Two a b generates this JavaScript code: function Two(value0, value1) { this.value0 = value0; this.value1 = value1;
}; Two.create = function (value0) { return function (value1) { return new Two(value0, value1); };
}; Here, values of the object type Two can be created using the new keyword, or by using the Two.create function. The case of newtypes is slightly different. Recall that a newtype is like an algebraic data type, restricted to having a single constructor taking a single argument. In this case, the runtime representation of the newtype is actually the same as the type of its argument. For example, this newtype representing telephone numbers: newtype PhoneNumber = PhoneNumber String is actually represented as a JavaScript string at runtime. This is useful for designing libraries, since newtypes provide an additional layer of type safety, but without the runtime overhead of another function call.

