We might want to wrap JavaScript values and functions for a number of reasons: A function takes multiple arguments, but we want to call it like a curried function. We might want to use the Effect monad to keep track of any JavaScript side-effects. It might be necessary to handle corner cases like null or undefined, to give a function the correct runtime representation. For example, suppose we wanted to recreate the head function on arrays by using a foreign declaration. In JavaScript, we might write the function as follows: function head(arr) { return arr[0];
} However, there is a problem with this function. We might try to give it the type forall a. Array a -> a, but for empty arrays, this function returns undefined. Therefore, this function does not have the correct runtime representation, and we should use a wrapper function to handle this corner case. To keep things simple, we can throw an exception in the case of an empty array. Strictly speaking, pure functions should not throw exceptions, but it will suffice for demonstration purposes, and we can indicate the lack of safety in the function name: foreign import unsafeHead :: forall a. Array a -> a In our foreign JavaScript module, we can define unsafeHead as follows: exports.unsafeHead = function(arr) { if (arr.length) { return arr[0]; } else { throw new Error('unsafeHead: empty array'); }
};

