Throwing an exception in the case of failure is less than ideal - idiomatic PureScript code uses the type system to represent side-effects such as missing values. One example of this approach is the Maybe type constructor. In this section, we will build another solution using the FFI. Suppose we wanted to define a new type Undefined a whose representation at runtime was like that for the type a, but also allowing the undefined value. We can define a foreign type using the FFI using a foreign type declaration . The syntax is similar to defining a foreign function: foreign import data Undefined :: Type -> Type Note that the data keyword here indicates that we are defining a type, not a value. Instead of a type signature, we give the kind of the new type. In this case, we declare the kind of Undefined to be Type -> Type. In other words, Undefined is a type constructor. We can now simplify our original definition for head: exports.head = function(arr) { return arr[0];
}; And in the PureScript module: foreign import head :: forall a. Array a -> Undefined a Note the two changes: the body of the head function is now much simpler, and returns arr[0] even if that value is undefined, and the type signature has been changed to reflect the fact that our function can return an undefined value. This function has the correct runtime representation for its type, but is quite useless since we have no way to use a value of type Undefined a. But we can fix that by writing some new functions using the FFI! The most basic function we need will tell us whether a value is defined or not: foreign import isUndefined :: forall a. Undefined a -> Boolean This is easily defined in our foreign JavaScript module as follows: exports.isUndefined = function(value) { return value === undefined;
}; We can now use isUndefined and head together from PureScript to define a useful function: isEmpty :: forall a. Array a -> Boolean
isEmpty = isUndefined <<< head Here, the foreign functions we defined were very simple, which meant that we were able to benefit from the use of PureScript's typechecker as much as possible. This is good practice in general: foreign functions should be kept as small as possible, and application logic moved into PureScript code wherever possible.

