PureScript's Prelude contains an interesting set of examples of foreign types. As we have covered already, PureScript's function types only take a single argument, and can be used to simulate functions of multiple arguments via currying . This has certain advantages - we can partially apply functions, and give type class instances for function types - but it comes with a performance penalty. For performance critical code, it is sometimes necessary to define genuine JavaScript functions which accept multiple arguments. The Prelude defines foreign types which allow us to work safely with such functions. For example, the following foreign type declaration is taken from the Prelude in the Data.Function.Uncurried module: foreign import data Fn2 :: Type -> Type -> Type -> Type This defines the type constructor Fn2 which takes three type arguments. Fn2 a b c is a type representing JavaScript functions of two arguments of types a and b, and with return type c. The functions package defines similar type constructors for function arities from 0 to 10. We can create a function of two arguments by using the mkFn2 function, as follows: import Data.Function.Uncurried uncurriedAdd :: Fn2 Int Int Int
uncurriedAdd = mkFn2 \n m -> m + n and we can apply a function of two arguments by using the runFn2 function: > runFn2 uncurriedAdd 3 10
13 The key here is that the compiler inlines the mkFn2 and runFn2 functions whenever they are fully applied. The result is that the generated code is very compact: var uncurriedAdd = function (n, m) { return m + n | 0;
}; For contrast, here is a traditional curried function: curriedAdd :: Int -> Int -> Int
curriedAdd n m = m + n and the resulting generated code, which is less compact due to the nested functions: var curriedAdd = function (n) { return function (m) { return m + n | 0; };
};

