Asynchronous code in JavaScript typically uses callbacks to structure program flow. For example, to read text from a file, the preferred approach is to use the readFile function and to pass a callback - a function that will be called when the text is available: function readText(onSuccess, onFailure) { var fs = require('fs'); fs.readFile('file1.txt', { encoding: 'utf-8' }, function (error, data) { if (error) { onFailure(error.code); } else { onSuccess(data); } });
} However, if multiple asynchronous operations are involved, this can quickly lead to nested callbacks, which can result in code which is difficult to read: function copyFile(onSuccess, onFailure) { var fs = require('fs'); fs.readFile('file1.txt', { encoding: 'utf-8' }, function (error, data1) { if (error) { onFailure(error.code); } else { fs.writeFile('file2.txt', data, { encoding: 'utf-8' }, function (error) { if (error) { onFailure(error.code); } else { onSuccess(); } }); } });
} One solution to this problem is to break out individual asynchronous calls into their own functions: function writeCopy(data, onSuccess, onFailure) { var fs = require('fs'); fs.writeFile('file2.txt', data, { encoding: 'utf-8' }, function (error) { if (error) { onFailure(error.code); } else { onSuccess(); } });
} function copyFile(onSuccess, onFailure) { var fs = require('fs'); fs.readFile('file1.txt', { encoding: 'utf-8' }, function (error, data) { if (error) { onFailure(error.code); } else { writeCopy(data, onSuccess, onFailure); } });
} This solution works but has some issues: It is necessary to pass intermediate results to asynchronous functions as function arguments, in the same way that we passed data to writeCopy above. This is fine for small functions, but if there are many callbacks involved, the data dependencies can become complex, resulting in many additional function arguments. There is a common pattern - the callbacks onSuccess and onFailure are usually specified as arguments to every asynchronous function - but this pattern has to be documented in module documentation which accompanies the source code. It is better to capture this pattern in the type system, and to use the type system to enforce its use. Next, we will see how to use the techniques we have learned so far to solve these issues.

