Let's translate the copyFile example above into PureScript by using the FFI. In doing so, the structure of the computation will become apparent, and we will be led naturally to a monad transformer which is defined in the transformers package - the continuation monad transformer ContT. Note : in practice, it is not necessary to write these functions by hand every time. Asynchronous file IO functions can be found in the node-fs and node-fs-aff libraries. First, we need to gives types to readFile and writeFile using the FFI. Let's start by defining some type synonyms, and a new effect for file IO: foreign import data FS :: Effect type ErrorCode = String
type FilePath = String readFile takes a filename and a callback which takes two arguments. If the file was read successfully, the second argument will contain the file contents, and if not, the first argument will be used to indicate the error. In our case, we will wrap readFile with a function which takes two callbacks: an error callback (onFailure) and a result callback (onSuccess), much like we did with copyFile and writeCopy above. Using the multiple-argument function support from Data.Function for simplicity, our wrapped function readFileImpl might look like this: foreign import readFileImpl :: forall eff . Fn3 FilePath (String -> Eff (fs :: FS | eff) Unit) (ErrorCode -> Eff (fs :: FS | eff) Unit) (Eff (fs :: FS | eff) Unit) In the foreign JavaScript module, readFileImpl would be defined as: exports.readFileImpl = function(path, onSuccess, onFailure) { return function() { require('fs').readFile(path, { encoding: 'utf-8' }, function(error, data) { if (error) { onFailure(error.code)(); } else { onSuccess(data)(); } }); };
}; This type signature indicates that readFileImpl takes three arguments: a file path, a success callback and an error callback, and returns an effectful computation which returns an empty (Unit) result. Notice that the callbacks themselves are given types which use the Eff monad to track their effects. You should try to understand why this implementation has the correct runtime representation for its type. writeFileImpl is very similar - it is different only in that the file content is passed to the function itself, not to the callback. Its implementation looks like this: foreign import writeFileImpl :: forall eff . Fn4 FilePath String (Eff (fs :: FS | eff) Unit) (ErrorCode -> Eff (fs :: FS | eff) Unit) (Eff (fs :: FS | eff) Unit) exports.writeFileImpl = function(path, data, onSuccess, onFailure) { return function() { require('fs').writeFile(path, data, { encoding: 'utf-8' }, function(error) { if (error) { onFailure(error.code)(); } else { onSuccess(); } }); };
}; Given these FFI declarations, we can write the implementations of readFile and writeFile. These will use the Data.Function.Uncurried module to turn the multiple-argument FFI bindings into regular (curried) PureScript functions, and therefore have slightly more readable types. In addition, instead of requiring two callbacks, one for successes and one for failures, we can require only a single callback which responds to either successes or failures. That is, the new callback takes a value in the Either ErrorCode monad as its argument: readFile :: forall eff . FilePath -> (Either ErrorCode String -> Eff (fs :: FS | eff) Unit) -> Eff (fs :: FS | eff) Unit
readFile path k = runFn3 readFileImpl path (k <<< Right) (k <<< Left) writeFile :: forall eff . FilePath -> String -> (Either ErrorCode Unit -> Eff (fs :: FS | eff) Unit) -> Eff (fs :: FS | eff) Unit
writeFile path text k = runFn4 writeFileImpl path text (k $ Right unit) (k <<< Left) Now we can spot an important pattern. Each of these functions takes a callback which returns a value in some monad (in this case Eff (fs :: FS | eff)) and returns a value in the same monad . This means that when the first callback returns a result, that monad can be used to bind the result to the input of the next asynchronous function. In fact, that's exactly what we did by hand in the copyFile example. This is the basis of the continuation monad transformer , which is defined in the Control.Monad.Cont.Trans module in transformers. ContT is defined as a newtype as follows: newtype ContT r m a = ContT ((a -> m r) -> m r) A continuation is just another name for a callback. A continuation captures the remainder of a computation - in our case, what happens after a result has been provided after an asynchronous call. The argument to the ContT data constructor looks remarkably similar to the types of readFile and writeFile. In fact, if we take the type a to be the type Either ErrorCode String, r to be Unit and m to be the monad Eff (fs :: FS | eff), we recover the right-hand side of the type of readFile. This motivates the following type synonym, defining an Async monad, which we will use to compose asynchronous actions like readFile and writeFile: type Async eff = ContT Unit (Eff eff) For our purposes, we will always use ContT to transform the Eff monad, and the type r will always be Unit, but this is not required. We can treat readFile and writeFile as computations in the Async monad, by simply applying the ContT data constructor: readFileCont :: forall eff . FilePath -> Async (fs :: FS | eff) (Either ErrorCode String)
readFileCont path = ContT $ readFile path writeFileCont :: forall eff . FilePath -> String -> Async (fs :: FS | eff) (Either ErrorCode Unit)
writeFileCont path text = ContT $ writeFile path text With that, we can write our copy-file routine by simply using do notation for the ContT monad transformer: copyFileCont :: forall eff . FilePath -> FilePath -> Async (fs :: FS | eff) (Either ErrorCode Unit)
copyFileCont src dest = do e <- readFileCont src case e of Left err -> pure $ Left err Right content -> writeFileCont dest content Note how the asynchronous nature of readFileCont is hidden by the monadic bind expressed using do notation - this looks just like synchronous code, but the ContT monad is taking care of wiring our asynchronous functions together. We can run this computation using the runContT handler by providing a continuation. The continuation represents what to do next , i.e. what to do when the asynchronous copy-file routine completes. For our simple example, we can just choose the logShow function as the continuation, which will print the result of type Either ErrorCode Unit to the console: import Prelude import Control.Monad.Eff.Console (logShow)
import Control.Monad.Cont.Trans (runContT) main = runContT (copyFileCont "/tmp/1.txt" "/tmp/2.txt") logShow

