As another example of using ContT to handle asynchronous functions, we'll now look at the Network.HTTP.Client module from this chapter's source code. This module uses the Async monad to support asynchronous HTTP requests using the request module, which is available via NPM. The request module provides a function which takes a URL and a callback, makes a HTTP(S) request and invokes the callback when the response is available, or in the event of an error. Here is an example request: require('request')('http://purescript.org'), function(err, _, body) { if (err) { console.error(err); } else { console.log(body); }
}); We will recreate this simple example in PureScript using the Async monad. In the Network.HTTP.Client module, the request method is wrapped with a function getImpl: foreign import data HTTP :: Effect type URI = String foreign import getImpl :: forall eff . Fn3 URI (String -> Eff (http :: HTTP | eff) Unit) (String -> Eff (http :: HTTP | eff) Unit) (Eff (http :: HTTP | eff) Unit) exports.getImpl = function(uri, done, fail) { return function() { require('request')(uri, function(err, _, body) { if (err) { fail(err)(); } else { done(body)(); } }); };
}; Again, we can use the Data.Function.Uncurried module to turn this into a regular, curried PureScript function. As before, we turn the two callbacks into a single callback, this time accepting a value of type Either String String, and apply the ContT constructor to construct an action in our Async monad: get :: forall eff. URI -> Async (http :: HTTP | eff) (Either String String)
get req = ContT \k -> runFn3 getImpl req (k <<< Right) (k <<< Left)

